Silky hair with new care✨
@ghdhairde has made the impossible possible! The new ghd duet style is the first 2-in-1 hot air styler that transforms hair from wet to styled with just one tool and without damaging your hair! At the touch of a button, the ghd duet style becomes a ghd styler, working at the optimum ghd styling temperature of 185°C.
